import React, { Component } from "react";
import CustomizedSlider from "./CustomizedSlider";
import Paper from "@material-ui/core/Paper";
import { withStyles, makeStyles } from "@material-ui/core/styles";
import Typography from "@material-ui/core/Typography";
import { textAlign } from "@material-ui/system";

export default class ControlCenter extends Component {
  constructor(props) {
    super(props);
    this.state = {
      Slider_1: 100
    };
  }
  handleSlide_1 = (event, value) => {
    this.setState({ Slider_1: value });
  };

  renderSlider(i) {
    return (
      <CustomizedSlider className="Slider_1" coChange={this.handleSlide_1} />
    );
  }

  render() {
    return (
      <Paper style={controlStyle}>
        <Typography gutterBottom>Array Range</Typography>
        {this.renderSlider(1)}
        <p>
          <span>{"The value of this slider is: "}</span>
          <span>{this.props.Slider_1}</span>
          <span>{" from a range of 0 to 200 inclusive"}</span>
        </p>
      </Paper>
    );
  }
}

const controlStyle = {
  width: 400,
  padding: "20px",
  textAlign: "center"
};
